import { Link } from "react-router-dom";
import Skill from "../components/Skill";
import { Button } from "@mui/material";
import classes from "./Home.module.css"

function HomePage() {
    return (
        <div className={classes.content60}>
            <h1>Annie Teng</h1>
            <p>
            Detail-oriented project manager with 5 years of experience across healthcare and semiconductor, adept at encompassing Scrum Master responsibilities, QA testing, sprint planning based on engineers' capacities and collaborating with Product and Software Development teams to effectively meet project deadlines. 
            </p>
            <Link to="/about-me">
                <div  className={classes.link}>
                <Button variant="contained" color="success" size="mdeium">
                <b>My Experience</b>
             </Button>
                </div>
            </Link>
            <Skill/>

        </div>

    )
}

export default HomePage;
